import React from "react";
import {
  Header,
  Title,
  Text,
  TitleWrapper,
  HeaderContent,
  SwitchContainer,
  Switch,
} from "./styles";

const HeaderComponent = (props) => {
  return (
    <Header>
      <HeaderContent>
        <TitleWrapper>
          <Title>Social Media Dashboard</Title>
          <Text>Total Followers: 23,004</Text>
        </TitleWrapper>
        <SwitchContainer>
          <Text>Dark mode</Text>
          <Switch
            onChange={() => {
              console.log("Click en dark mode");
            }}
          />
          <input type="checkbox" name="dark-mode" />
        </SwitchContainer>
      </HeaderContent>
    </Header>
  );
};
export default HeaderComponent;
